    brand: "",
    model: "",
    serialNumber: "",
    size: "",
    purchaseDate: "",
    purchasePrice: "",
    arrivalDate: "",
    saleValue: "",
  });
  const {
    brand,
    model,
    serialNumber,
    size,
    purchaseDate,
    purchasePrice,
    arrivalDate,
    saleValue,
  } = ssd;

  const onInputChange = (e) => {
    setSsd({
      ...ssd,
      [e.target.brand]: e.target.value,
      [e.target.model]: e.target.value,
      [e.target.serialNumber]: e.target.value,
      [e.target.size]: e.target.value,
      [e.target.purchaseDate]: e.target.value,
      [e.target.purchasePrice]: e.target.value,
      [e.target.arrivalDate]: e.target.value,
      [e.target.saleValue]: e.target.value,
    });
  };
  const handleSubmit = async (e) => {
    e.preventDefault();
    console.log(brand, model);

    const category = {
      productCategory,
    };

    const formData = new FormData();
    formData.append("file", file);
    try {
      const response = await axios.post(url, ssd, formData, category, {
        // brand: brand,
        // model: model,
        // serialNumber: serialNumber,
        // size: size,
        // purchaseDate: purchaseDate,
        // purchasePrice: purchasePrice,
        // arrivalDate: arrivalDate,
        // saleValue: saleValue,
      });
      console.log(response.data);
    } catch (error) {
      console.log(error.response);
    }
  };

  return (
    <div className="meuForm">
      <div className="form-row">
        <form onSubmit={(e) => handleSubmit(e)}>
          <div className="col-md-6 offset-md-3">
            <input type="file" name="file" onChange={handleImage} />
          </div>

          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="brand"
              id="brand"
              value={brand}
              className="form-control"
              placeholder="Brand"
              onChange={(e) => onInputChange(e)}
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="model"
              id="model"
              className="form-control"
              value={model}
              placeholder="Model"
              onChange={(e) => onInputChange(e)}
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="serialNumber"
              id="serialNumber"
              className="form-control"
              value={serialNumber}
              placeholder="Serial Number"
              onChange={(e) => onInputChange(e)}
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="size"
              id="size"
              className="form-control"
              value={size}
              placeholder="Size"
              onChange={(e) => onInputChange(e)}
            />
          </div>

          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="purchaseDate"
              id="purcaseDate"
              className="form-control"
              value={purchaseDate}
              placeholder="Purcase date"
              onChange={(e) => onInputChange(e)}
            />
          </div>

          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="purchasePrice"
              id="purchasePrice"
              className="form-control"
              value={purchasePrice}
              placeholder="Purchase price"
              onChange={(e) => onInputChange(e)}
            />
          </div>

          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="arrivalDate"
              id="arrivalDate"
              className="form-control"
              value={arrivalDate}
              placeholder="Arrival date"
              onChange={(e) => onInputChange(e)}
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="productCategory"
              id="productCategory"
              className="form-control"
              value={productCategory}
              placeholder="Product category"
              onChange={(e) => onInputChange(e)}
            />
          </div>
          <div>
            <input
              type={"text"}
              name="saleValue"
              id="saleValue"
              value={saleValue}
              className="form-control"
              placeholder="saleValue"
              onChange={(e) => onInputChange(e)}
            />
          </div>

          <div className="col-md-6 offset-md-3">
            <button
              type="submit"
              className="btn btn-success"
              // onChange={(e) => this.handleSubmit(e)}
            >
              Salvar
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};
export default AddSsd;
